nd family, they are distinct people with very different personalities, needs, tastes and desires. But to the outside world they are a medical mystery -- particularly given the fact that they can do virtually all the same things as their friends, including playing the piano, riding a bike, swimming and playing softball \"Their personalities make them inspirational,\" says their mother Patty. \"They never give up; anything they want to do, they go out and do it.\"\r\n\r\nThe medical world is keen to find out how two separate brains and nervous systems can work in such a perfectly co-ordinated way, but the twins and their family have always resisted non-essential medical tests. \"The family want to treat them as though they are just like everyone else,\" says Joy Westerdahl, the girls' doctor, who admits that it is a mystery how their unique physiology functions.\r\n\r\nAs they enter adulthood, the twins are likely to leave the haven of their home town and face the wider world. In preparation for that time, they have taken part in this intimate documentary to show the world what it is like to be joined for life.\r\n\r\n"},{"text":"http://en.wikipedia.org/wiki/Abigail_...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIr67W7fuS6gIV3MRVCh3CVQM3SPqyjfqNjrLPKw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fen.wikipedia.org%2Fwiki%2FAbigail_and_Brittany_Hensel\u0026redir_token=3UtM14eY7a_LVheDYBrEu-aPFnl8MTU5MjgzMDk2MEAxNTkyNzQ0NTYw\u0026event=video_description\u0026v=K57IcN9DWXo","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fen.wikipedia.org%2Fwiki%2FAbigail_and_Brittany_Hensel\u0026redir_token=3UtM14eY7a_LVheDYBrEu-aPFnl8MTU5MjgzMDk2MEAxNTkyNzQ0NTYw\u0026event=video_description\u0026v=K57IcN9DWXo","target":"TARGET_NEW_WINDOW","nofollow":true}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Subscribe"},"navigationEndpoint":{"click he same things as their friends, including playing the piano, riding a bike, swimming and playing softball \"Their personalities make them inspirational,\" says their mother Patty. \"They never give up; anything they want to do, they go out and do it.\"\r\n\r\nThe medical world is keen to find out how two separate brains and nervous systems can work in such a perfectly co-ordinated way, but the twins and their family have always resisted non-essential medical tests. \"The family want to treat them as though they are just like everyone else,\" says Joy Westerdahl, the girls' doctor, who admits that it is a mystery how their unique physiology functions.\r\n\r\nAs they enter adulthood, the twins are likely to leave the haven of their home town and face the wider world. In preparation for that time, they have taken part in this intimate documentary to show the world what it is like to be joined for life.\r\n\r\nhttp://en.wikipedia.org/wiki/Abigail_and_Brittany_Hensel"},"lengthSeconds":"2729","ownerProfileUrl":"http://www.youtube.com/user/subsymmetric","externalChannelId":"UCBqhy_jiZ76EmSHhqMVnLKA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","N
